insert into international (internationalId,languageId,namespace,message,lastUpdated) values (71,6,'MessageBoard','Meddelandeforum, ven kallat diskussionsgrupper, r ett enkelt stt att skapa en interaktiv och levande webbplats. Meddelandeforumen kan ven vara av intern karaktr.\r\n\r\n<b>Meddelanden per sida</b>\r\nNr en beskare frst kommer till meddelandeforumet kommer denna att presenteras en lista med alla mnen (ven kallat trdar). Meddelanden per sida anger hur mnga mnen som kommer visas p varje sida.\r\n\r\n<b>Vem kan skicka inlgg?</b>\r\nVlj en grupp som tillts skicka inlgg.\r\n\r\n<b>Redigerings-timeout</b>\r\nHur lng tid har en anvndare p sig att redigera sitt inlgg innan det blir lst?\r\n\r\n<i>Kommentar:</i> Stt inte denna grns fr hgt. En bra sak med diskussionsforum r att de r en historik ver vad som sagts. Om anvndarna tillts ndra sina egna inlgg lngt bak i tiden kan det skapa oklarheter om vad som verkligen skrivits.\r\n\r\n<b>Karmaper inlgg</b>\r\nHur mycket karma ska ges till anvndaren fr ett inlgg?\r\n\r\n<b>Vem kan moderera?</b>\r\nVlj en grupp som modererar forumet.\r\n\r\n<b>Modereringstyp?</b>\r\nDu kan vlja vilken typ av moderering av anvndarnas inlgg. <i>Efterhand</i> betyder att inlgget visas fr alla direkt och att moderatorn kan ta bort det i efterhand. <i>Frhand</i> betyder att moderatorn mste godknna inlgget innan det publiceras.\r\n\r\n<i>Kommentar:</i> En moderator kan alltid g in och redigera och ta bort inlgg, oavsett modereringstyp.', 1050526877);
