insert into international (internationalId,languageId,namespace,message,lastUpdated) values (71,6,'FileManager','Nerladdningshanteraren r designad fr att hjlpa dig hantera distrubitionen av filer p din webbplats. Den hjlper dig vlja vem som ska ha tilltrde till filerna.\r\n\r\n<b>Radbryt efter</b>\r\nHur mnga filer ska visas per sida. Om antalet filer verstiger detta vrde, delas listan upp p flera sidor.\r\n\r\n<b>Visa miniatyrbilder?</b>\r\nMarkera denna om du vill att visa miniatyrer av bilderna i filhanteraren. Notera att miniatyren endast syns fr huvudfilen, fr de alternativa versionerna visas ingen miniatyr.\r\n\r\n<b>Fortstt att lgga upp filer?</b>\r\nMarkera denna om du vill fortstta att lgga upp filer nr du gjort dina instllningar.', 1050403611);
